import React from "react";

export default function ProfileMainContent() {
    return (
        <div className="profilemaincontent">
            <div className="maincontent-left">
                <div className="maincontent-director">Paul Thomas Anderson</div>
                <div className="maincontent-title">There Will Be Blood</div>
                <div className="maincontent-synopsis">2008</div>
            </div>
            <div className="maincontent-right">
            </div>
        </div>
    )
}
